    // Function to show the image
    function showImage() {
        // Change the source of the image
        const imageUrl = 'file:///media/fuse/drivefs-c42dcc2d06fb7e3dae4edccd57ac33fe/root/%22Google%20Classroom%22/Screenshot%202024-11-06%209.52.32%20PM.png'; // Replace with your image URL

        img.src = imageUrl;

        // Display the image container
        const container = document.getElementById('image-container');
        container.style.display = 'block'; // Show the image container
    }

    // Function to hide the image (optional)
    function hideImage() {
        const container = document.getElementById('image-container');
        container.style.display = 'none'; // Hide the image container
    }

    // Event listener for keydown events
    document.addEventListener('keydown', (event) => {
        // Check if Ctrl and 'h' are pressed
        if (event.key === '`') {
            event.preventDefault(); // Prevent default browser behavior
            showImage(); // Show the image
        }

        // Optional: Add a way to hide the image (e.g., hitting Esc)
        if (event.key === 'Escape') {
            hideImage(); // Hide the image when Esc is pressed
        }
    });
